Look, we love you guys, but we all gotta do our part to keep our communities healthy. We're committed to social distancing and flattening the curve, but that doesn't mean dropping off the face of the earth (or social media), right?
〰️
So here's an update on us: we'll be hard at work (albeit from home) for as long as our clients need help with their legal questions. And now a question for you: what else do you need from us right now? What would you like to see here?
