“Ghostly.” I came upon this shot on my way back to the car,  after photographing one of the craziest sunsets I'd ever experienced in the Sierra (see my image "Fire in the Sky"). The moon had crested the horizon not long before, and was casting an eerie glow on the surrounding landscape, diffused a bit by high clouds. All of the other photographers had dispersed by this point, and I got to enjoy a rare moment at this location listening to nothing but wind and coyotes.

Stay safe out there, people!

